import React from "react";
import Transaction from "./Transaction";

function TransactionsList({transactionsArray, transactionSetter, sear}) {
  const transactions = transactionsArray.map((transaction)=> {
    return <Transaction 
    key={transaction.id} 
    transaction={transaction}
    />
  }
  );
  return (
    <table className="table table-bordered border-primary">
    <tbody>
     <tr>
     <th>
        <h3 className="ui center header red">Date</h3>
     </th>
     <th>
        <h3 className="ui center header red">Description</h3>
     </th>
     <th>
        <h3 className="ui center header red">Category</h3>
     </th>
     <th>
        <h3 className="ui center header red">Amount</h3>
     </th>
     </tr>
     {transactions}
    </tbody>
  </table>
  );
}


export default TransactionsList;
